import GnG from './components/home_components/GnG';
import Home from './components/Home';
import Navbar from './components/Navbar';
import { BrowserRouter, Route, Router, Routes } from 'react-router-dom'
import VRC from './components/home_components/VRC';
import DR from './components/home_components/DR';
import SPIC from './components/home_components/SPIC';
import Vendors from './components/Vendors';
import Assets from './components/Assets';
import Spares from './components/Spares';
import AMC from './components/AMC';
import Admin from './components/Admin';
import Login from './components/Login';
import GnG_Admin from './components/admin_components/GnG';
import VRC_Admin from './components/admin_components/VRC';
import DR_Admin from './components/admin_components/DR';
import SPIC_Admin from './components/admin_components/SPIC';




function App() {
  return (
    <div className='font-[Montserrat] overflow-x-hidden w-full min-h-screen absolute bg-stone-200'>

      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Navbar />}>
            <Route path='' element={<Home />}>
              <Route index element={<GnG />} />
              <Route path="vrc" element={<VRC />} />
              <Route path="dr" element={<DR />} />
              <Route path="spic" element={<SPIC />} />
            </Route>
            <Route path="/vendors" element={<Vendors />} />
            <Route path="/assets" element={<Assets />} />
            <Route path="/spares" element={<Spares />} />
            <Route path="/amc" element={<AMC />} />
            <Route path="/admin" element={<Admin />}>
              <Route index element={<GnG_Admin dataCenter={1} />} />
              <Route path="vrc" element={<GnG_Admin dataCenter={2} />} />
              <Route path="dr" element={<DR_Admin />} />
              <Route path="spic" element={<SPIC_Admin />} />
            </Route>
            <Route path="/login" element={<Login />} />
          </Route>

        </Routes>
      </BrowserRouter>
    </div>

    //  TODO: Implement routes
    // <Routes>

    // </Routes>

  );
}

export default App;
